const publicDir = `${Meteor.settings.public.cdn}/public`;

export default class LocationImport extends Component {

  constructor(props) {
    super(props);
    this.state = {
      location_list_imported : [],
      hide_btn : false
    };
  }

  handleSubmit = (event) => {
    event.preventDefault();
    this.setState({
      hide_btn : true
    });

    Location_List.map( async (location) => {

      // Find the text field via the React ref
      const locationName        = location.locationName.trim();
      const locationEMail       = location.locationEmail.trim();
      const currentUserClientId = Meteor.user().profile.clientId;
      const clientId            = currentUserClientId;

      if (locationName.length   <= 0) return;
      // if (locationEMail.length  <= 6) return;
      Meteor.call('locations.insert', locationName, locationEMail, clientId);

      var temp_array = this.state.location_list_imported;

      temp_array.push(location);

      console.log(temp_array.length, location);
      this.setState({ location_list_imported : temp_array });
    });


  };




  render() {
    return (
      <div>
        {
          (!this.state.hide_btn)?
            <div className="form-row" align="center">
              <Button
              onClick={this.handleSubmit}
              fullWidth={true}
              color="primary"
              variant="contained"
              >
              Import
              </Button>
            </div>
          :
            null
        }
        <h5>Total Imported Location {this.state.location_list_imported.length} outof { Location_List.length}</h5>
        <table>
          <tr>
            <th>Location Name</th>
            <th>Location Email</th>
          </tr>
          {
            this.state.location_list_imported.map((location) => (
              <tr>
                <td>{location.locationName.trim()}</td>
                <td>{location.locationEmail.trim()}</td>
              </tr>
            ))
          }
        </table>
      </div>
    );
  }
}
// props
Location.propTypes = {
  location: PropTypes.object.isRequired,
};
